import {FETCH_SUCCESS} from '../constants';

const initialState = {
    firstTemplate: [],
    secondTemplate: [],
    threeTemplate: [],
}
export default function addTemplates(state = initialState, action) {
    switch (action.type){
        // case FETCH_SUCCESS:
            // return state;
        default: return state;
    }
}
